INSERT INTO `tb_macroprocess` (`idMacroprocess`, `mp_name`, `mp_description`, `mp_status`, `mp_registrationDate`, `mp_updateDate`) VALUES
	(1, 'I. Gestión De Documentos Y Normativas En SSOMA', 'La Gestión de Documentos y Normativas en Seguridad, Salud y Medio Ambiente (SSOMA) es el proceso de organizar, controlar y mantener toda la información y documentación relacionada con el sistema de gestión SSOMA de una organización, con el fin de cumplir con la legislación vigente, prevenir riesgos, proteger a los trabajadores y al medio ambiente.', 'Activo', '2025-09-04 22:57:51', '2025-09-05 22:51:19'),
	(2, 'II. Aplicaciones De Gestión SSOMA', 'Las aplicaciones de gestión SSOMA son softwares o plataformas diseñadas para administrar de forma integrada los aspectos de Seguridad y Salud en el Trabajo y el Medio Ambiente en una organización, permitiendo el cumplimiento normativo y la mejora continua a través de funciones como registro de incidentes, gestión de riesgos, monitoreo, auditorías, y generación de reportes y análisis. Estas herramientas facilitan la prevención de accidentes y enfermedades, la protección ambiental, y la eficiencia operativa.', 'Activo', '2025-09-04 22:58:09', '2025-09-05 22:51:23');
